Miscellaneous
Just some SAS stuff I've collected over time. Enjoy!

If you need more info just ask!




Elite World Cops is a television series starring former SAS soldier and author Chris Ryan. Ryan travels the world meeting some of the worlds most elite police units

Commando - On The Front Line, director Chris Terrill embarks on a courageous 12-month journey to Afghanistan alongside Britain's most elite front line troops--the Royal Marine Commandos

Great SAS Missions - The Complete Series Profiles the missions of Special Air Services (SAS) regiment. Features computer generated imaging (CGI), rare film footage, seven re-enactments and former members recount their own stories

Hunting Chris Ryan is a documentary produced by the BBC in 2003. It comprised three hour-long episodes, each pitting SAS veteran Chris Ryan against a four-man 'Hunter Force' whilst he completed a set objective, his mission being evasion and ultimately extraction once the objective was complete

