SPECIAL FORCES Inside Story- British SAS American documentary recreating the ill-fated Bravo Two Zero mission

SAS Survival Secrets Behind Enemy Lines, Guardians Against terror, Sabre Squadron.
Recreations of typical SAS missions. Eddie Stone and other veterans further explain their weaponry, combat evasions and survival tactics

SAS The Soldiers Story Selection and Training

Special Forces Heroes interviews, re-enactments and graphics reveal four action-packed 50-minute tales of SAS missions

The Story of the SAS The story of the elite fighting force which can be deployed to North African deserts or the jungles of Borneo

SAS Britain's Secret Warriors Film about the history, methods and training of the SAS. Andy Mcnab also talks about the Bravo Two Zero mission and his capture

SAS Are You Tough Enough - Highlands a British documentary series exposing volunteer members of the public to the experience of the SAS selection process presented by Dermot O'Leary

